import React from 'react';
import { Link } from 'react-router-dom';
import '.../styles.css'; // Ensure to import your CSS file

const Home = () => {
    return (
        <div className="container">
            <div className="header">
                <h1>Welcome to the Location Finder App</h1>
            </div>
            <div className="summary">
                <p>
                    This application helps users to find nearby places based on their location.
                    Users can easily register and log in to access location-based services,
                    making it convenient to discover essential services like pharmacies, hospitals, restaurants, and more.
                    Experience a user-friendly interface and simplified navigation as you explore the world around you.
                </p>
            </div>
            <div className="menu">
                <Link to="/register">Register</Link>
                <Link to="/login">Login</Link>
                <Link to="/map">Go to Map</Link>
            </div>
        </div>
    );
};

export default Home;
